import React from 'react';

const DataTable = ({ zones, onChange }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Zone</th>
          <th>pH</th>
          <th>Humidity</th>
          <th>Moisture</th>
        </tr>
      </thead>
      <tbody>
        {zones.map((z, i) => (
          <tr key={i}>
            <td>{i + 1}</td>
            <td><input type="number" step="0.1" value={z.pH} onChange={(e) => onChange(i, 'pH', e.target.value)} /></td>
            <td><input type="number" value={z.humidity} onChange={(e) => onChange(i, 'humidity', e.target.value)} /></td>
            <td><input type="number" value={z.moisture} onChange={(e) => onChange(i, 'moisture', e.target.value)} /></td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default DataTable;
